  input: '"TEXT","F3XA","C00055582","The Committee continues to use the best efforts
    procedures outlined by the FEC to obtain identification information for all individuals
    who contribute in excess of $200 in a calendar year.  All solicitations for funds
    request the required information for proper filing.  Where there is incomplete
    information, a separate follow up letter requesting the complete information and
    advising of the requirements of federal law for the reporting of such information
    is mailed to the individual accompanied by a business reply envelope.  Information
    that is received after the initial filing is reported to the FEC is filed as an
    amendment to the original filing.  Employer and occupation information that has
    been received in response to our follow-up, stand alone effort is reported on
    Schedule A.  The Schedule H2 ratios and Schedule H4 payments for the Annual Dinner
    Event 5/17/07 are correctly reported.  Payments to vendors were made in the beginning
    of May and prior to the event using the previously disclosed ratio of 50/50.  Payments
    made after the event were made using a final adjusted ratio based on the actual
    funds received breakout."'
